                    <li className={styles.listItem}>
                        <p className={styles.listText}>Минут</p>
                        <input className={styles.listInput} type="text" />
                    </li>

                    <li className={styles.listItem}>
                        <p className={styles.listText}>Деняк</p>
                        <input className={styles.listInput} type="text" />
                    </li>
                </ul>
            </div>
        </article>
    );
}

export default ComputerDetails;
